import React from "react";
import propType from "prop-types";
import { Dots } from "./dotbutton-styles";

const DotButton = ({ Click }) => <Dots onClick={Click} />;

export default DotButton;

DotButton.prototype = {
  onClick: propType.func.isRequired,
};
